import React from'react';
import './Field.css'





const Field= () => {
    return(
            <div className='form'>
                <input type='text' id='email' className='form-input' autoComplete='off'/>
                <label for='email' className='form-label'>Email
                <span class="input__label">Some Fancy Label</span>
                </label>
                
            </div>
    );
}

export default Field;
